import styled from 'styled-components';

export const Container = styled.div`
  flex: 1;
  flex-direction: row;
  background: rgba(	238, 65, 49, 0.6);
  height: 100%;
  width: 100%;
`;

export const Imagem = styled.img`
    margin-left: 0%;
`;

export const DivImagem = styled.div`
    margin-left: 35%;
`;

export const DivInput = styled.div`
`;
